import { LOGIN } from './actionType'

export const login = (email, password) => {
    return {
        type: LOGIN,
        email,
        password
    }
}

export const error = (email, password) => {
    return {
        type: ERROR,
        email,
        password
    }
}

export const success = (email, password) => {
    return {
        type: SUCCESS,
        email,
        password
    }
}
